import React, { Component } from 'react';

import ResponsiveDrawer from './Layout';


class IndexTutorial extends Component {
  constructor(props){
    super(props)
    this.state={
      reacttutorialIndex:[]
    }
    fetch('/api/react')
    .then(res=>res.json())
    .then(response=>this.setState({reacttutorialIndex:response}))
  }

  render() {
    switch (this.props.match.url) {
      case '/react':
        <ResponsiveDrawer tutoName="React" tutorialIndex={this.state.reacttutorialIndex} />
        break
      case '/redux':
        <ResponsiveDrawer tutoName="React" tutorialIndex={this.state.reacttutorialIndex} />
        break;
      default:
        <ResponsiveDrawer tutoName="React" tutorialIndex={this.state.reacttutorialIndex} />
    }
    return (
      <div>
        {console.log(this.props.match.url)}
        

      </div>
    );
  }
}

export default IndexTutorial;
